import React from "react";

function Product({ productItems }) {
  return (
    <>
      <div>
        {
            productItems.map((productItems)=>{
              return   <div>
              <h3>
               {productItems.name}
               </h3> 
           </div>
            })
        }
      </div>
    </>
  );
}

export default Product;
